from typing import List
class Solution:
    def maxProduct(self, nums: List[int]) -> int:
        if not nums or len(nums) == 0:
            return None
        ans = nums[0]
        n = len(nums)
        d = [[None] * n for _ in range(n)]
        zero = []
        for i, num in enumerate(nums):
            d[i][i] = num
            ans = max(ans, num)
            if num == 0:
                zero.append(i)
                ans = max(ans, 0)
                continue
            left = 0
            if d[i] == 0:
                left = zero[-1] + 1
            j = i - 1
            while j >= left:
                if d[j][i-1] != None:
                    d[j][i] = d[j][i-1] * num
                else:
                    d[j][i] = d[j+1][i] * nums[j]
                ans = max(ans, d[j][i])
                j -= 1
        return ans
           
